ylist with a minimum of 5 years in the industry. The ideal candidate will have expertise in cutting, coloring, and styling techniques for all hair types.</p>\", \"8dbb931e-123e-469f-baa8-f9e0922c487e\": [{\"col1\": \"Provide exceptional hair services to clients including cutting, coloring, and styling\"}, {\"col1\": \"Stay updated on the latest hair trends and techniques\"}, {\"col1\": \"Maintain a clean and organized workspace\"}, {\"col1\": \"Build and maintain a loyal client base\"}, {\"col1\": \"Collaborate with team members for special events and promotions\"}], \"aeee56b7-88b4-40ce-9098-7421787c94ba\": true}',1,'2025-07-15 16:17:40','2025-07-15 16:17:40','bdac8001-75c8-4261-80ea-92283f0ca4b3'),(740,740,1,'Careers','careers','careers',NULL,1,'2025-07-15 16:17:40','2025-07-15 16:17:40','651a6790-5f38-4f42-af81-a01854dd020f'),(743,743,1,'Careers','careers','careers',NULL,1,'2025-07-15 16:20:01','2025-07-15 16:20:01','5cf3deda-604b-4c7c-910e-70fe941c2c93'),(748,748,1,'Senior Hair Stylist','senior-hair-stylist',NULL,'{\"1ea8bdf2-0ecc-401b-b504-ebe3b45ce893\": [{\"col1\": \"Minimum 5 years of experience as a hair stylist\"}, {\"col1\": \"Valid cosmetology license\"}, {\"col1\": \"Strong portfolio demonstrating technical skills\"}, {\"col1\": \"Excellent customer service skills\"}, {\"col1\": \"Ability to work weekends and some evenings\"}], \"5be3a1bd-bbb9-4db3-bf73-6fd541cc0d56\": \"<p>We are looking for an experienced hair stylist with a minimum of 5 years in the industry. The ideal candidate will have expertise in cutting, coloring, and styling techniques for all hair types.</p>\", \"8dbb931e-123e-469f-baa8-f9e0922c487e\": [{\"col1\": \"Provide exceptional hair services to clients including cutting, coloring, and styling\"}, {\"col1\": \"Stay updated on the latest hair trends and techniques\"}, {\"col1\": \"Maintain a clean and organized workspace\"}, {\"col1\": \"Build and maintain a loyal client base\"}, {\"col1\": \"Collaborate with team members for special events and promotions\"}], \"aeee56b7-88b4-40ce-9098-7421787c94ba\": true}',1,'2025-07-15 16:20:16','2025-07-15 16:20:16','b0b48935-796d-488b-87bc-7313775f05ea'),(749,749,1,'Senior Hair Stylist','senior-hair-stylist',NULL,'{\"1ea8bdf2-0ecc-401b-b504-ebe3b45ce893\": [{\"col1\": \"Minimum 5 years of experience as a hair stylist\"}, {\"col1\": \"Valid cosmetology license\"}, {\"col1\": \"Strong portfolio demonstrating technical skills\"}, {\"col1\": \"Excellent customer service skills\"}, {\"col1\": \"Ability to work weekends and some evenings\"}], \"5be3a1bd-bbb9-4db3-bf73-6fd541cc0d56\": \"<p>We are looking for an experienced hair stylist with a minimum of 5 years in the industry. The ideal candidate will have expertise in cutting, coloring, and styling techniques for all hair types.</p>\", \"8dbb931e-123e-469f-baa8-f9e0922c487e\": [{\"col1\": \"Provide exceptional hair services to clients including cutting, coloring, and styling\"}, {\"col1\": \"Stay updated on the latest hair trends and techniques\"}, {\"col1\": \"Maintain a clean and organized workspace\"}, {\"col1\": \"Build and maintain a loyal client base\"}, {\"col1\": \"Collaborate with team members for special events and promotions\"}], \"aeee56b7-88b4-40ce-9098-7421787c94ba\": false}',1,'2025-07-15 16:20:16','2025-07-16 09:53:22','5e8a89fd-659a-4512-bb03-bb3401847287'),(750,750,1,'Careers','careers','careers',NULL,1,'2025-07-15 16:20:16','2025-07-15 16:20:16','674785e7-e699-4834-98e6-31fcc2e9ea53'),(753,753,1,'Careers','careers','careers',NULL,1,'2025-07-15 16:22:01','2025-07-15 16:22:01','c911b949-3a3f-4718-9461-9436fcd09aae'),(761,761,1,'Continuous Education','continuous-education',NULL,'{\"39291855-d367-4b20-bb2c-744c49a726ca\": \"fa-graduation-cap\", \"b17ef90b-6729-4e8e-90b4-5dd1685325b2\": \"We invest in our team\'s growth with regular training sessions, workshops, and opportunities to attend industry events.\"}',1,'2025-07-15 16:25:31','2025-07-15 16:25:31','8603ac7d-03b5-44ee-bea2-32b8415d5ed9'),(762,762,1,'Careers Growth','career-growth',NULL,'{\"39291855-d367-4b20-bb2c-744c49a726ca\": \"fa-chart-line\", \"b17ef90b-6729-4e8e-90b4-5dd1685325b2\": \"Clear career pathways and mentorship opportunities allow you to advance your skills and take on new challenges.\"}',1,'2025-07-15 16:25:31','2025-07-16 09:26:10','47131a5f-59b3-498b-96fb-ad374ca5f774'),(763,763,1,'Supportive Team','supportive-team',NULL,'{\"39291855-d367-4b20-bb2c-744c49a726ca\": \"fa-user-friends\", \"b17ef90b-6729-4e8e-90b4-5dd1685325b2\": \"Join a collaborative and inclusive environment where creativity and individual expression are valued.\"}',1,'2025-07-15 16:25:31','2025-07-15 16:25:31','adb1f980-c8b9-4796-bf38-72497e9a4c69'),(764,764,1,'Recognition & Rewards','recognition-rewards',NULL,'{\"39291855-d367-4b20-bb2c-744c49a726ca\": \"fa-award\", \"b17ef90b-6729-4e8e-90b4-5dd1685325b2\": \"Competitive compensation, performance bonuses, and employee recognition programs to celebrate your achievements.\"}',1,'2025-07-15 16:25:31','2025-07-15 16:25:31','4eab6f8a-66da-4803-a357-e86c70daeab5'),(765,765,1,'Careers','careers','careers',NULL,1,'2025-07-15 16:25:31','2025-07-15 16:25:31','f6cea405-587b-4e56-8f54-de6ff9f15056'),(766,766,1,NULL,NULL,NULL,'{\"142aa15d-567a-46df-916c-b02423b97f51\": \"<h2><strong>Our Workplace Culture</strong></h2><p>At The Leading Edge, we foster a culture of creativity, respect, and continuous growth. We believe that happy team members provide the best service to our clients, which is why we prioritize creating a positive and supportive work environment.</p><p>We celebrate diversity and believe that each team member brings unique perspectives and talents that contribute to our collective success. Our collaborative approach encourages sharing ideas and learning from one another.</p><p>If you\'re passionate about beauty, dedicated to excellence, and love making people feel their best, we\'d love to hear from you!</p>\", \"908577ca-aba6-4a12-8385-e8bd2bf2e7bb\": [767]}',1,'2025-